import React from 'react';

function ClubCard({club}){

    const {id, description, genre, owner_id, title} = club

    return(
        <div>
             <div>
                 <h3>{title}</h3>
             </div>
             <div>
                 <h5>{description}</h5>
             </div>
             <div>
                 <h5>{genre}</h5>
             </div>
        </div>
    )
}
export default ClubCard;
